let LOGO = "AFSSY";
function App() {
    return (
        <div>
            {/* <h1>Advance Farming Support System</h1>
            <h1>Hello How are you?</h1> */}
            <h1>{LOGO}</h1>
            <select className="languages">
                <option value="Choose Your Languages">Choose Your Languages</option>
                <option value="English">English</option>
                <option value="Gujarati">Gujarati</option>
                <option value="Hindi">Hindi</option>
                <option value="Marathi">Marathi</option>
            </select>
            <nav>
                <li>Home</li>
                <li>Gov.Scemes</li>
                <li>Gov.Info</li>
                <li>NewsLetter</li>
                <li>Login/SignUp</li>
                <li>FAQS</li>
                <li>App Guide</li>
            </nav>
        </div>     
    )
}
export default App;
